import React, { useState } from 'react';
import { SafeAreaView } from 'react-native';
import styleSheet from './Pages/PageStyle';
import MaterialTabPage from './Pages/MaterialTabPage';
import { ScrollView } from 'react-native-gesture-handler';
import FCHomePage from './FunctionalComponents/FCHomePage';
import { NavigationContainer } from '@react-navigation/native';
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import FCWines from './FunctionalComponents/FCWines';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';

function App() {
  const Tab = createMaterialBottomTabNavigator();

  return (
    <NavigationContainer>
      <Tab.Navigator
        initialRouteName="Home"
        activeColor="#f0edf6"
        barStyle={{ backgroundColor: '#691A1A' }}
      >
        <Tab.Screen name="Home" component={FCHomePage}
          options={{
            tabBarIcon: ({ color }) => (
              <MaterialCommunityIcons name="home" color={color} size={30} />
            ),
          }}
        />
        <Tab.Screen name="Groups" component={FCHomePage}
          options={{
            tabBarIcon: ({ color }) => (
              <MaterialCommunityIcons name="group" color={color} size={30} />
            ),
          }}
        />
        <Tab.Screen name="Camera" component={FCHomePage}
          options={{
            tabBarIcon: ({ color }) => (
              <MaterialCommunityIcons name="camera" color={color} size={30} />
            ),
          }}
        />
         <Tab.Screen name="Wines" component={FCHomePage}
          options={{
            tabBarIcon: ({ color }) => (
              <MaterialCommunityIcons name="access-point" color={color} size={30} />
            ),
          }}
        />
         <Tab.Screen name="Events" component={FCHomePage}
          options={{
            tabBarIcon: ({ color }) => (
              <MaterialCommunityIcons name="event" color={color} size={30} />
            ),
          }}
        />
      </Tab.Navigator>
    </NavigationContainer>
  );
}


export default App;
